# 新地学二分类模型
geo_model2 = fasttext.load_model('/mnt/geogpt/duyuxuan/train_fasttext/geo_ft_model_case_1.bin')

def pred_by_model(content):
    new_geo_labels, new_geo_scores = geo_model2.predict(content, k=1)
    new_geo_label = new_geo_labels[0]
    new_geo_score = new_geo_scores[0]

    return new_geo_label, new_geo_score


