        "Anarchism is a political philosophy and movement that is skeptical of all justifications for authority and seeks to abolish the institutions it claims maintain unnecessary coercion and hierarchy, typically including nation states,ps=: \"...as many anarchists have stressed, it is not government as such that they find objectionable, but the hierarchical forms of government associated with the nation state.\" and capitalism. Anarchism advocates for the replacement of the state with stateless societies and voluntary free associations. As a historically left-wing movement, this reading of anarchism is placed on the farthest left of the political spectrum, usually described as the libertarian wing of the socialist movement (libertarian socialism).\nHumans have lived in societies without formal hierarchies long before the establishment of states, realms, or empires. With the rise of organised hierarchical bodies, scepticism toward authority also rose. Although traces of anarchist ideas are found all throughout history, modern anarchism emerged from the Enlightenment. During the latter half of the 19th and the first decades of the 20th century, the anarchist movement flourished in most parts of the world and had a significant role in workers' struggles for emancipation. Various anarchist schools of thought formed during this period. Anarchists have taken part in several revolutions, most notably in the Paris Commune, the Russian Civil War and the Spanish Civil War, whose end marked the end of the classical era of anarchism. In the last decades of the 20th and into the 21st century, the anarchist movement has been resurgent once more, growing in popularity and influence within anti-capitalist, anti-war and anti-globalisation movements.\nAnarchists employ diverse approaches, which may be generally divided into revolutionary and evolutionary strategies; there is significant overlap between the two. Evolutionary methods try to simulate what an anarchist society might be like, but revolutionary tactics, which have historically taken a violent turn, aim to overthrow authority and the state. Many facets of human civilization have been influenced by anarchist theory, critique, and praxis.\n\n\n\n## Etymology, terminology, and definition\n\nWilhelm Weitling is an example of a writer who added to anarchist theory without using the exact term.pp=22–23\nThe etymological origin of anarchism is from the Ancient Greek anarkhia, meaning \"without a ruler\", composed of the prefix an- (\"without\") and the word arkhos (\"leader\" or \"ruler\"). The suffix -ism denotes the ideological current that favours anarchy.2p=217 Anarchism appears in English from 1642 as anarchisme and anarchy from 1539; early English usages emphasised a sense of disorder.3p=260 Various factions within the French Revolution labelled their opponents as anarchists, although few such accused shared many views with later anarchists. Many revolutionaries of the 19th century such as William Godwin (1756–1836) and Wilhelm Weitling (1808–1871) would contribute to the anarchist doctrines of the next generation but did not use anarchist or anarchism in describing themselves or their beliefs.pp=27–37\nThe first political philosopher to call himself an anarchist (anarchiste) was Pierre-Joseph Proudhon (1809–1865), marking the formal birth of anarchism in the mid-19th century.",
        "Milestones\n\nThe first Best Actor awarded was Emil Jannings, for his performances in The Last Command and The Way of All Flesh. He had to return to Europe before the ceremony, so the Academy agreed to give him the prize earlier; this made him the first Academy Award winner in history. At that time, winners were recognized for the entirety of their work done in a certain category during the qualifying period; for example, Jannings received the award for two movies in which he starred during that period, and Janet Gaynor later won a single Oscar for performances in three films. With the fourth ceremony, however, the system changed, and professionals were honored for a specific performance in a single film. For the first six ceremonies, the eligibility period spanned two calendar years.\nAt the 29th ceremony, held in 1957, the Best Foreign Language Film category, now known as Best International Feature Film, was introduced. Until then, foreign-language films had been honored with the Special Achievement Award.\nPerhaps the most widely seen streaker in history was 34-year-old Robert Opel, who streaked across the stage of The Dorothy Chandler Pavilion in Los Angeles flashing a peace sign on national US television at the 46th Academy Awards in 1974. Bemused host David Niven quipped, \"Isn't it fascinating to think that probably the only laugh that man will ever get in his life is by stripping off and showing his shortcomings?\" Later, evidence arose suggesting that Opel's appearance was facilitated as a publicity stunt by the show's producer Jack Haley Jr..\nRobert Metzler, the show's business manager, believed that the incident had been planned in some way; during the dress rehearsal Niven had asked Metzler's wife to borrow a pen so he could write down the famous line, which was thus not the ad-lib it appeared to be.\nThe 74th Academy Awards, held in 2002, presented the first Academy Award for Best Animated Feature.\nFrom 1973 to 2020 and since 2022, all Academy Awards ceremonies have ended with the Academy Award for Best Picture. For 2021, this tradition was broken as the ceremony ended with the Academy Award for Best Actor.\nTraditionally, the previous year's winner for Best Actor and Best Supporting Actor present the awards for Best Actress and Best Supporting Actress, while the previous year's winner for Best Actress and Best Supporting Actress presents the awards for Best Actor and Best Supporting Actor.\nOn February 9, 2020, Parasite became the first foreign-language film to win Best Picture at the award ceremony of 92nd Academy Awards.\nTom Hanks announced, at the 2020 Oscar Ceremony, the opening of the Academy Museum of Motion Pictures on December 14, 2020. The museum development started in 2017 under Kerry Brougher, but is now led by Bill Kramer. The industry-curated exhibits are geared toward the history of motion pictures and the art & science of film making, exhibiting trailblazing directors, actors, film-makers, sound editors and more, and the museum houses famous artifacts from acclaimed movies such as Dorothy's Ruby Red Slippers from The Wizard of Oz.\nThe 93rd Academy Awards ceremony, honoring the best films of 2020 and early 2021, was held on April 25, 2021, after it was postponed from its original February 28, 2021, schedule due to the impact of the COVID-19 pandemic on cinema. ",
        "Life\n\n\n\n### Early life\n\nRand was born Alisa Zinovyevna Rosenbaum on February 2, 1905, to a Russian-Jewish bourgeois family living in Saint Petersburg.p=xiii She was the eldest of three daughters of Zinovy Zakharovich Rosenbaum, a pharmacist, and Anna Borisovna (Kaplan).pp=3–5 She was twelve when the October Revolution and the rule of the Bolsheviks under Vladimir Lenin disrupted the life the family had enjoyed previously. Her father's pharmacy was nationalized,p=31 and the family fled to the city of Yevpatoria in Crimea, which was initially under the control of the White Army during the Russian Civil War.p=35 After graduating high school there in June 1921,p=36 she returned with her family to Petrograd (as Saint Petersburg was then named), where they faced desperate conditions, occasionally nearly starving.pp=86–87\nRand's first published work was a monograph in Russian about actress Pola Negri.\nWhen Russian universities were opened to women after the revolution, Rand was among the first to enroll at Petrograd State University.p=15 At 16, she began her studies in the department of social pedagogy, majoring in history.p=72 Along with many other bourgeois students, she was purged from the university shortly before graduating. After complaints from a group of visiting foreign scientists, many of the purged students were reinstated in the university.p=47 Rand was among these reinstated students and she completed her studies at the renamed Leningrad State University in October 1924.p=15 She then studied for a year at the State Technicum for Screen Arts in Leningrad. For an assignment, Rand wrote an essay about the Polish actress Pola Negri; it became her first published work.pp=49–50 By this time, she had decided her professional surname for writing would be Rand,p=33 and she adopted the first name Ayn (pronounced n).p=9\nIn late 1925, Rand was granted a visa to visit relatives in Chicago.pp=18–19 She departed on January 17, 1926,pp=50–51 and arrived in New York City on February 19, 1926.p=53 Intent on staying in the United States to become a screenwriter, she lived for a few months with her relatives learning EnglishHicks before leaving for Hollywood, California.pp=57–60\nIn Hollywood, a chance meeting with famed director Cecil B. DeMille led to work as an extra in his film The King of Kings and a subsequent job as a junior screenwriter.",
        "Early life\n\nAndre Agassi was born in Las Vegas, Nevada, to Emmanuel \"Mike\" Agassi (Aghassian), a former Olympic boxer from Iran, and American Elizabeth \"Betty\" Agassi (née Dudley). His father is of Armenian and Assyrian heritage. Andre Agassi's mother, Betty, is a breast cancer survivor. He has three older siblings – Rita (last wife of former number one Pancho Gonzales), Philip and Tami. Andre was given the middle name Kirk after Kirk Kerkorian, an Armenian American billionaire. Emmanuel Agassi, then a waiter at Tropicana Las Vegas, had met Kerkorian in 1963.\nAt the age of 12, Agassi and his good friend and doubles partner, Roddy Parks, won the 1982 National Indoor Boys 14s Doubles Championship in Chicago. Agassi describes memorable experiences and juvenile pranks with Roddy in his book Open.\nWhen he was 13, Agassi was sent to Nick Bollettieri's Tennis Academy in Florida. He was meant to stay for only three months, because that was all his father could afford. After thirty minutes of watching Agassi play, Bollettieri, deeply impressed by his talent, called Mike and said: \"Take your check back. He's here for free.\" Agassi then dropped out of school in the ninth grade to pursue a full-time tennis career.\n\n## Professional career\n\n\n\n### 1986–1993: Breakthrough and the first major title\n\nAgassi when he played the Davis Cup Americas zone in Buenos Aires, 1988\nAgassi turned professional at the age of 16 and competed in his first tournament at La Quinta, California. He won his first match against John Austin, but then lost his second match to Mats Wilander. By the end of 1986, Agassi was ranked No. 91. He won his first top-level singles title in 1987 at the Sul American Open in Itaparica and ended the year ranked No. 25. He won six additional tournaments in 1988 (Memphis, U.S. Men's Clay Court Championships, Forest Hills WCT, Stuttgart Outdoor, Volvo International and Livingston Open), and, by December of that year, he had surpassed US$1 million in career prize money after playing in just 43 tournaments—the fastest anyone in history had reached that level. During 1988, he also set the open-era record for most consecutive victories by a male teenager (a record that stood for 17 years until Rafael Nadal broke it in 2005). His year-end ranking was No. 3, behind second-ranked Ivan Lendl and top-ranked Mats Wilander. Both the Association of Tennis Professionals and Tennis magazine named Agassi the Most Improved Player of the Year for 1988.\nIn addition to not playing the Australian Open (which later became his best Grand Slam event) for the first eight years of his career, Agassi chose not to play at Wimbledon from 1988 through 1990 (although he first played there in 1987, only to lose in the first round to Henri Leconte) and publicly stated that he did not wish to play there because of the event's traditionalism, particularly its \"predominantly white\" dress code to which players at the event are required to conform.",
        "Notable performances\n\nKatharine Lee Bates, ca. 1880–1890\nElvis Presley performed it many times in concerts starting in 1976.\nBing Crosby included the song in a medley on his album 101 Gang Songs (1961).\nFrank Sinatra recorded the song with Nelson Riddle during the sessions for The Concert Sinatra in February 1963, for a projected 45 single release. The 45 was not commercially issued however, but the song was later added as a bonus track to the enhanced 2012 CD release of The Concert Sinatra.\nIn 1976, while the United States celebrated its bicentennial, a soulful version popularized by Ray Charles peaked at number 98 on the US R&B chart.efn|Ray Charles' 1972 recording of this song was inducted into the Grammy Hall of Fame in 2005. His version was traditionally played on New Year's Eve in Times Square following the ball drop.\nThree different renditions of the song have entered the Hot Country Songs charts. The first was by Charlie Rich, which went to number 22 in 1976. A second, by Mickey Newbury, peaked at number 82 in 1980. Aretha Franklin performed a rendition before an undisputed audience of 93,173 to open WrestleMania III, a performance meta-critic RJ City called \"a lovely version\". An all-star version of \"America the Beautiful\" performed by country singers Trace Adkins, Sherrié Austin, Billy Dean, Vince Gill, Carolyn Dawn Johnson, Toby Keith, Brenda Lee, Lonestar, Lyle Lovett, Lila McCann, Lorrie Morgan, Jamie O'Neal, The Oak Ridge Boys, Collin Raye, Kenny Rogers, Keith Urban and Phil Vassar reached number 58 in July 2001. The song re-entered the chart following the September 11 attacks.\nBarbra Streisand released an official music video footage during Norman Lear's Special in 1982.\nDuring her peak to stardom, R&B singer Mariah Carey sang the song at the 1990 NBA Finals.\nWhitney Houston also recorded the song, covering Ray Charles' soulful rearranged version as the b-side to her 1991 rendition of \"The Star Spangled Banner\".\nThe song has been performed as part of the Indianapolis 500 pre-race ceremonies since 1991.\nThe US singer\/songwriter Martin Sexton recorded a gospel-tinged version on his LP 'Black Sheep', released in 1996. \nPopularity of the song increased greatly in the decades following 9\/11; at some sporting events it was sung in addition to the traditional singing of the national anthem. During the first taping of the Late Show with David Letterman following the attacks, CBS newsman Dan Rather cried briefly as he quoted the fourth verse.\nFor Super Bowl XLVIII, The Coca-Cola Company aired a multilingual version of the song, sung in several different languages. The commercial received some criticism on social media sites, such as Twitter and Facebook, and from some conservatives, such as Glenn Beck.",
        "Jewish and Christian interpretations\n\nAccording to the narrative in Genesis, Abel (הֶבֶל Hébel, in pausa הָבֶל Hā́ḇel; Ἅβελ Hábel; lang-ar|هابيل, Hābēl) is Eve's second son. His name in Hebrew is composed of the same three consonants as a root meaning \"breath\". Julius Wellhausen has proposed that the name is independent of the root. Eberhard Schrader had previously put forward the Akkadian (Old Assyrian dialect) ablu (\"son\") as a more likely etymology.\nThe First Mourning (Adam and Eve mourn the death of Abel); oil on canvas 1888 painting by William-Adolphe Bouguereau \nIn Christianity, comparisons are sometimes made between the death of Abel and that of Jesus, the former thus seen as being the first martyr. In 23:35 Jesus speaks of Abel as \"righteous\", and the Epistle to the Hebrews states that \"The blood of sprinkling ... speaks better things than that of Abel\" (12:24). The blood of Jesus is interpreted as bringing mercy; but that of Abel as demanding vengeance (hence the curse and mark).\nAbel is invoked in the litany for the dying in the Roman Catholic Church, and his sacrifice is mentioned in the Canon of the Mass along with those of Abraham and Melchizedek. The Alexandrian Rite commemorates him with a feast day on December 28.\nAccording to the Coptic Book of Adam and Eve (at 2:1–15), and the Syriac Cave of Treasures, Abel's body, after many days of mourning, was placed in the Cave of Treasures, before which Adam and Eve, and descendants, offered their prayers. In addition, the Sethite line of the Generations of Adam swear by Abel's blood to segregate themselves from the unrighteous.\nIn the Book of Enoch (22:7), regarded by most Christian and Jewish traditions as extra-biblical, the soul of Abel is described as having been appointed as the chief of martyrs, crying for vengeance, for the destruction of the seed of Cain. A similar view is later shown in the Testament of Abraham (A:13 \/ B:11), where Abel has been raised to the position as the judge of the souls.\nIn Bereshit Rabbah (22:2), a discussion of Gen. 4:1 ff. has Rabbi Yehoshua ben Korcha mentioning that Cain was born with a twin sister, and Abel with two twin sisters.  This is based on the principle that the otherwise superfluous accusative article \"et\" always conveys some additional teaching (Pesachim 22b). The \"et\"'s are parsed slightly differently in Yebamot 62a where the two \"et\"'s in Gen. 4:2 indicate Cain and his sister, and Abel and his (one) sister.\n\n### Sethian Gnostic interpretation\n\nIn the Apocryphon of John, a work belonging to Sethian Gnosticism, Abel is the offspring of Yaldaboath and Eve, who is placed over the elements of water and earth as Elohim, but was only given his name as a form of deception.\n\n### HibilMandaean interpretation\n\nAccording to Mandaean beliefs and scriptures including the Qolastā, the Book of John and Genzā Rabbā, Abel is cognate with the angelic soteriological figure Hibil Ziwa, (ࡄࡉࡁࡉࡋ ࡆࡉࡅࡀ‎, sometimes translated \"Splendid Hibel\"), who is spoken of as a son of Hayyi or of Manda d-Hayyi, and as a brother to Anush (Enosh) and to Sheetil (Seth), who is the son of Adam. Elsewhere, Anush is spoken of as the son of Sheetil, and Sheetil as the son of Hibil, where Hibil came to Adam and Eve as a young boy when they were still virgins, but was called their son. ",
